import React from "react";
import Tile from "./Tile";

class Grid extends React.Component {

	constructor(props) {
		super(props);
		Grid.instance = this;
		Grid.instance.theVoid = getRandomInt(0,15);
		this.width = props.width + "px";
		this.height = props.height + "px";
		this.state = { }

	}

	getRandomInt(min, max) {
		min = Math.ceil(min);
		max = Math.floor(max);
		return Math.floor(Math.random() * (max - min)) + min;
	}

	render()
	{
		return(
			<div style={{width: this.width, height: this.height, border:"1px solid black", position: "relative"}}>
				<Tile x="0" y="0" label="_0" number={0} />
				<Tile x="1" y="0" label="_1" number={1} />
				<Tile x="2" y="0" label="_2" number={2} />
				<Tile x="3" y="0" label="_3" number={3} />
				<Tile x="0" y="1" label="_4" number={4} />
				<Tile x="1" y="1" label="_5" number={5} />
				<Tile x="2" y="1" label="_6" number={6} />
				<Tile x="3" y="1" label="_7" number={7} />
				<Tile x="0" y="2" label="_8" number={8} />
				<Tile x="1" y="2" label="_9" number={9} />
				<Tile x="2" y="2" label="_10" number={10} />
				<Tile x="3" y="2" label="_11" number={11} />
				<Tile x="0" y="3" label="_12" number={12} />
				<Tile x="1" y="3" label="_13" number={13} />
				<Tile x="2" y="3" label="_14" number={14} />
				<Tile x="3" y="3" label="_15" number={15} />
			</div>
			);
	}
}

Grid.instance;

export default Grid;
